actionConfiguration.body:
() => {
  let test = "";
  var i = 0;
  for (i = 0; i <= 6; i++) {
    storeValue("box", i);
    GetSelect_Workshift_Morning.run(i => {
      console.log(GetSelect_Workshift_Morning.data);
      if (GetSelect_Workshift_Morning.data == 0) {
        storeValue("box" + i, 'Blue');
        test = "Blue" + i;
      } else {
        if (GetSelect_Workshift_Morning.data[0].staff_total >= 9) {
          storeValue("box" + i, '#bbf7d0');
          test = "#bbf7d0" + i;
        } else {
          storeValue("box" + i, '#fef08a');
          test = "#fef08a" + i;
        }
      }
      console.log(test);
    });
  }
}

